import * as React from 'react'
import ProcessQueryData from '../../modules/LayeredNavigation/processQueryData'
import MainSearchPage from "../../components/LayeredNavigation/MainSearchPage"
import {NextPage} from 'next'
import "../../assets/scss/style.scss"

interface LocationItemProp {
  id: string|null;
  name: string|null;
  title: string|null;
  slug: string|null;
  seo_title: string|null;
  seo_description: string|null;
  image: string|null;
}

interface SearchPageProp {
  location: {
    city: LocationItemProp;
    ward: LocationItemProp;
    district: LocationItemProp;
  },
  dataQuery: DataQueryProp,
  slug: string
}

interface DataQueryProp {
  city: string|null,
  district: string|null,
  ward: string|null,
  home_direction: string|null,
  price_range: RangeValue,
  area_range: RangeValue,
  bed_room_number: RangeValue,
  title: string|null,
  name: string|null,
  page: number|null,
  limit: number|null,
  slug: string|null,
  sort_by: AdSellLeaseSortType
}

interface RangeValue {
  max: number;
  min: number;
}

interface QueryProp {
  query: any
}

interface AdSellLeaseSortType {
  time?: "newest" | "oldest",
  price?: "low_to_high" | "high_to_low",
  view?: "low_to_high" | "high_to_low",
  rate?: "high_to_low"
}

// @ts-ignore
const AdSellLeasesPage: NextPage<SearchPageProp> = (props: SearchPageProp) => {
  return (
    <h1>Chu dau tu</h1>
    // <MainSearchPage {...props} typePage={'project-index'}/>
  )
}

// @ts-ignore
AdSellLeasesPage.getInitialProps = async function(props: QueryProp) {
  let query = props.query;
  let propObject = ProcessQueryData.processQueryData(query, 'project-index');
  return propObject;
}

export default AdSellLeasesPage
